import {Component} from 'react'
import { connect } from 'react-redux'
import Todo from '../components/Todo.js'
// import ShowTodo from '../components/ShowTodo.js'
// import {getTodo} from '../actions/todoToShowAction'


class TodoIndex extends Component {

    render() {

    const filterCompletedTodos = this.props.todos.filter((todo) => todo.completed === false)
    const sortedByStarTodos = filterCompletedTodos.sort((b, a) => a.starred - b.starred)


    return (
        <div>
            {sortedByStarTodos.map(todo => 
                <Todo key={todo.id} todo={todo} completed/>
            )}
        </div>
    )
    }
}

export default connect()(TodoIndex)
